const getPriceItem = (item: ItemType) => {
    // axios.get(`https://card.wb.ru/cards/detail?locale=ru&nm=${item.id}`)
    axios.get(`https://card.wb.ru/cards/detail?spp=27&regions=80,64,83,4,38,33,70,68,69,86,30,40,48,1,22,66,31&pricemarginCoeff=1.0&reg=1&appType=1&emp=0&locale=ru&lang=ru&curr=rub&couponsGeo=2,12,7,3,6,18,21&sppFixGeo=4&dest=-1029256,-85617,-543140,-1586348&nm=${item.id}`)
        .then(function (response) {
            console.log(response.data.data.products)

            debugger
            console.log('item', item)
            if (!item.priceNew) {
                if (item.priceOld === String(response.data.data.products[0].salePriceU).slice(0, -2)) {
                    if (item.priceChanged !== 'no') item.priceChanged = 'no';
                    console.log('Цена не изменилась')
                } else {
                    console.log('Цена изменилась')
                    if (item) {
                        item.priceNew = String(response.data.data.products[0].salePriceU).slice(0, -2);
                        if (item.priceNew > item.priceOld) item.priceChanged = 'up'
                        if (item.priceNew < item.priceOld) item.priceChanged = 'down'
                        // setItems([...items])
                    }
                }
            } else {
                if (item.priceNew === String(response.data.data.products[0].salePriceU).slice(0, -2)) {
                    if (item.priceChanged !== 'no') item.priceChanged = 'no';
                    console.log('Цена не изменилась else')
                } else {
                    console.log('Цена изменилась else')
                    if (item) {
                        item.priceOld = item.priceNew;
                        item.priceNew = String(response.data.data.products[0].salePriceU).slice(0, -2);
                        if (item.priceNew > item.priceOld) item.priceChanged = 'up'
                        if (item.priceNew < item.priceOld) item.priceChanged = 'down'
                        // setItems([...items])
                    }
                }
            }
        })

        .catch(function (error) {
            // обработка ошибки
            console.log(error);
        })
        .then(function () {
            // выполняется всегда
        });
}

const testPrice = () => {
    items.forEach((item) => {
        getPriceItem(item)
    })
}


setTimeout(() => {
    testPrice()
}, 30000)


